import React, { useState, useEffect } from "react";
import getBreeds from "../helpers/getBreeds";

const initialBreeds = [
	{
		id: 1,
		name: "Boxer",
	},
	{
		id: 2,
		name: "Husky",
	},
	{
		id: 3,
		name: "Pintscher",
	},
];

const Select = () => {
    const [data, setBreeds] = useState(initialBreeds);

    useEffect(() => {
        updateBreeds();
    }, []);

    const updateBreeds = () => {
        getBreeds()
        .then((newBreeds) => {
            setBreeds(newBreeds)
        })
        .catch(
            console.log("Erro")
        )
    }

	return (
		<select onChange={() => alert("change")}>
			{{data}.map((breed) => (
				<option value={breed.id} key={breed.id}>
					{breed.name}
				</option>
			))}
		</select>
	);
};

export default Select;
